import * as React from 'react';
import { View, Text, StyleSheet} from 'react-native';
import { Button } from 'react-native-web';

export default function MealPlannerScreen({ navigation }) {
    return (
      <View>
        <Text style={{ position: 'absolute',
          width: 123, 
          height: 24,
          left: 30,
          top: 105,
          fontFamily: 'Poppins',
          fontStyle: 'normal',
          fontWeight: 600,
          fontSize: 16,
          lineHeight: 24 }}>Meal Nutritions</Text> 
        <Button
          title="Go to Breakfast"
          onPress={() => navigation.navigate('Breakfast')}
        />  
      </View>
    );
}
